import React from "react";
import headerLogo from "../images/svg/logo.svg";
import { Link, Route } from "react-router-dom";

function Header() {
  return (
    <header className="header">
      <img
        className="header__logo"
        alt="Логотип сайта Место"
        src={headerLogo}
      />
    </header>
  );
}

export default Header;
